import React from 'react';
import './GamePage.css';

import {uploads} from '../../utils/config'

//Hooks
import { useSelector, useDispatch } from 'react-redux';
import { useState, useEffect } from 'react';

//Redux
import { getGames } from '../../slices/gameSlice';
import { getUserGames, profile } from '../../slices/userSlice'

//router
import { useParams } from 'react-router-dom';

const GamePage = (gameImage, gameUserInfo) => {
  const { game } = useParams();

  const dispatch = useDispatch();
  
  const {games} = useSelector((state) => state.game);
  const { user } = useSelector((state) => state.user);

  console.log("gameImage: ", gameImage)
  console.log("game: ", game)

  //Load game and users data for the list of players
  useEffect(() => {
    dispatch(profile())
    dispatch()
    dispatch(getGames())
  }, [dispatch]);

  return (
    <div className="game-page">
      <img
        className="background-image"
        src={gameImage}
        alt="background"
      />
      <div className="game-list">
        {/* Seu componente de lista aqui */}
      </div>
    </div>
  );
};

export default GamePage;
